import React, { useEffect, useState } from "react";
import NextLink from "next/link";
import PropTypes from "prop-types";
import { Box, Button, Divider, Drawer, useMediaQuery } from "@mui/material";
import { ChartBar as ChartBarIcon } from "../../icons/chart-bar";
import { Cog as CogIcon } from "../../icons/cog";
import { Lock as LockIcon } from "../../icons/lock";
import { ShoppingBag as ShoppingBagIcon } from "../../icons/shopping-bag";
import { User as UserIcon } from "../../icons/user";
import { UserAdd as UserAddIcon } from "../../icons/user-add";
import { Users as UsersIcon } from "../../icons/users";
import { XCircle as XCircleIcon } from "../../icons/x-circle";
import BugReportIcon from "@mui/icons-material/BugReport";
import MapIcon from "@mui/icons-material/Map";
import { Logo } from "./logo";
import { NavItem } from "./nav-item";
import AuthService from "../../services/auth.service";
import ExitToAppIcon from "@mui/icons-material/ExitToApp";
import { useLocation, useNavigate } from "react-router-dom";
import ValueServices from "../../services/ValueServices";

var admin = false;
AuthService.isAdmin().then((response) => {
  console.log(response)
  admin = response.data;
});

const items = [
  {
    href: "/",
    icon: <ChartBarIcon fontSize="small" />,
    title: "Dashboard",
  },
  {
    href: "/customers",
    icon: <UsersIcon fontSize="small" />,
    title: "Customers",
  },
  {
    href: "/products",
    icon: <ShoppingBagIcon fontSize="small" />,
    title: "Products",
  },
  {
    href: "/account",
    icon: <UserIcon fontSize="small" />,
    title: "Account",
  },
  {
    href: "/settings",
    icon: <CogIcon fontSize="small" />,
    title: "Settings",
  },
  // {
  //   href: "/login",
  //   icon: <LockIcon fontSize="small" />,
  //   title: "Login",
  // },
  // {
  //   href: "/register",
  //   icon: <UserAddIcon fontSize="small" />,
  //   title: "Register",
  // },
  {
    href: "/testing",
    icon: <BugReportIcon fontSize="small" />,
    title: "Test",
  },
  {
    href: "/maps",
    icon: <MapIcon fontSize="small" />,
    title: "Mapas",
  },
  // {
  //   href: "/error",
  //   icon: <XCircleIcon fontSize="small" />,
  //   title: "Error",
  // },
];

// if admin is true remove customers from items
if (admin) {
  items.splice(1, 1);
}


const items2 = [
  {
    href: "/",
    icon: <ChartBarIcon fontSize="small" />,
    title: "Dashboard",
  },
  {
    href: "/account",
    icon: <UserIcon fontSize="small" />,
    title: "Account",
  },
  {
    href: "/login",
    icon: <LockIcon fontSize="small" />,
    title: "Login",
  },
];

export const DashboardSidebar = (props) => {
  const { open, onClose } = props;
  const lgUp = useMediaQuery((theme) => theme.breakpoints.up("lg"), {
    defaultMatches: true,
    noSsr: false,
  });
  const [admin, setAdmin] = useState(true);
  var navigate = useNavigate();
  const location = useLocation();

  function signout() {
    AuthService.logout();
    navigate("/login");
  }

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if (user) {
      AuthService.isAdmin().then((response) => {
        setAdmin(response.data);
        if (response.data === false) {
        } else {
        }
      });
    } else {
      navigate("/login");
    }
  }, [location.pathname, navigate]);

  function lat() {
    if (admin) {
      return (
        <div>
          {" "}
          {items.map((item) => (
            <NavItem
              key={item.title}
              icon={item.icon}
              href={item.href}
              title={item.title}
            />
          ))}
        </div>
      );
    } else {
      return (
        <div>
          {" "}
          {items2.map((item) => (
            <NavItem
              key={item.title}
              icon={item.icon}
              href={item.href}
              title={item.title}
            />
          ))}
        </div>
      );
    }
  }

  const content = (
    <>
      <Box sx={{ display: "flex", flexDirection: "column", height: "100%" }}>
        <div>
          <Box sx={{ p: 3 }}>
            <NextLink href="/" passHref>
              <a>
                <Logo sx={{ height: 42, width: 42 }} />
              </a>
            </NextLink>
          </Box>
          <Box sx={{ px: 2 }}>
            <Box
              sx={{
                alignItems: "center",
                backgroundColor: "rgba(255, 255, 255, 0.04)",
                cursor: "pointer",
                display: "flex",
                justifyContent: "space-between",
                px: 3,
                py: "11px",
                borderRadius: 1,
              }}
            ></Box>
          </Box>
        </div>
        <Divider sx={{ borderColor: "#2D3748", my: 3 }} />
        <Box sx={{ flexGrow: 1 }}>
          {items.map((item) => (
            <div key={item.title}>
              <NavItem
                key={item.title}
                icon={item.icon}
                href={item.href}
                title={item.title}
              />
              <Divider
                sx={{ borderColor: "#2D3748", my: 1 }}
                variant="middle"
              />
            </div>
          ))}
        </Box>
        <Divider sx={{ borderColor: "#2D3748", my: 3 }} />

        <Box sx={{ px: 2, py: 3 }}>
          <Box
            sx={{
              display: "flex",
              mx: "auto",
              width: "160px",
              "& img": {
                width: "100%",
              },
            }}
          ></Box>

          <Button
            color="error"
            endIcon={<ExitToAppIcon />}
            fullWidth
            onClick={signout}
            variant="contained"
          >
            Signout
          </Button>
        </Box>
      </Box>
    </>
  );

  if (lgUp) {
    return (
      <Drawer
        anchor="left"
        open
        PaperProps={{
          sx: { backgroundColor: "neutral.900", color: "#FFFFFF", width: 280 },
        }}
        variant="permanent"
      >
        {content}
      </Drawer>
    );
  }

  return (
    <Drawer
      anchor="left"
      onClose={onClose}
      open={open}
      PaperProps={{
        sx: { backgroundColor: "neutral.900", color: "#FFFFFF", width: 280 },
      }}
      sx={{ zIndex: (theme) => theme.zIndex.appBar + 100 }}
      variant="temporary"
    >
      {content}
    </Drawer>
  );
};

DashboardSidebar.propTypes = {
  onClose: PropTypes.func,
  open: PropTypes.bool,
};
